import { apiKey, PLAYLISTS, YOUTUBEURL } from './apis';

export const playlist = async () => {
  return await fetch(`
        ${YOUTUBEURL}${PLAYLISTS}?key=${apiKey}&channelId=${ids.ma}&maxResult=10&part=id,snippet
    `).then((res) => res.json);
};
